import React from "react";
import styled from "styled-components";
import TextField from "@mui/material/TextField";

const Wrapper = styled.section`
  .contact {
    text-align: center;
    h2 {
      font-size: 45px;
    }
    .partners-inner {
      .right {
        padding: 0 5%;
        img{
          width: 20%;
          bo

        }
      }
    }
  }
  img {
    width: 100%;
  }
`;

function Contact() {
  return (
    <Wrapper>
      <div className="contact">
        <h2>Stay Engaged</h2>
        <div className="partners-inner">
          <div className="left">
            <img src="./images/engaged.png" alt="image" />
          </div>
          <div className="right">
            <div className="images">
              <a href="https://www.instagram.com">
                <img src="./images/e1.jpg" alt="video" />
                <img src="./images/e2.jpg" alt="image" />
                <img src="./images/e3.jpg" alt="image" />
                <img src="./images/e4.jpg" alt="video" />
              </a>
            </div>
            <div className="links">
              <a href="https://www.instagram.com">Instagram</a>
              <a href="https://www.linkedIn.com">LinkedIn </a>
              <a href="https://www.blog.com"> Blog</a>
            </div>
            <div className="form">
              <h5>Sign Up For Our Mailing List</h5>
              <form action="#">
                <TextField
                  id="filled-basic"
                  label="First Name"
                  variant="filled"
                />
                <TextField
                  id="filled-basic"
                  label="Last Name"
                  variant="filled"
                />
                <TextField id="filled-basic" label="Email" variant="filled" />
              </form>
              <button>Submit</button>
            </div>
          </div>
        </div>
      </div>
    </Wrapper>
  );
}

export default Contact;
